  false,\n\t\"url\": null,\n\t\"notes\": \"LOCATION: Lat. 39040u201931u201dN, Long.
  9306u201928u201dW, 23.5 miles southeast of Chillicothe, MO, Charlton County. Gage
  is located at southwest corner of bridge crossing on Stutman Road (County Road TT).
  DRAINAGE AREA: 25.3 square miles SURFACE WATER RECORDS. PERIOD OF RECORD: April
  29, 2010 to present. GAGE SITE: Sutron Monitor 1 in metal gage housing in communication
  with a KPSI submersible pressure transducer mounted on a fencepost in the streambed
  under the bridge. Instruments are powered by a solar panel run to a battery inside
  the gage housing. Stage data are collected at 15 minute intervals. NATIONAL WILDLIFE
  REFUGE: Swan Lake NWRREMARKS: Stage and discharge records coded FAIR for 2010 calendar
